import React from 'react';
import './App.css';
import logo from './logo.png';
import { BrowserRouter as Router, Switch, Route, Routes, useNavigate } from 'react-router-dom';
import SellAnItem from './SellAnItem';

function App() {

  const navigate = useNavigate();

  const navigateToSellAnItem = () => {
    navigate('/sell'); // Use the correct path here
  };

  return (
    <Router> {/* Wrap your component hierarchy inside a Router */}
      <div>
        <div className="container">
          <img src={logo} alt="Logo" style={{ width: '300px', height: '90px', marginBottom: '80px', marginTop: '30px' }} />
          <button >Mint Token</button>
          <button onClick={navigateToSellAnItem}>Sell an Item</button>
          <button>List all items for sale</button>
          <button>Change price of an item</button>
        </div>
        <Routes>
          <Route path="/sell" element={<SellAnItem/>} />
        </Routes>
      </div>
    </Router> // Close the Router
  );
}

export default App;
